const MenusNavigation = ({ menusRef }) => {
  let { value } = useContext(globalContext)
  const { contextSafe } = useGSAP()
  let [hidden, sethidden] = useState(false)
  useEffect(() => {
    sethidden(menusRef.current.scrollWidth > menusRef.current.offsetWidth)
  })
  useEffect(() => {
    if (menusRef.current) {
      sethidden(menusRef.current.scrollWidth > menusRef.current.offsetWidth)
    }
  }, [menusRef]);

  const back = contextSafe(() => {
    gsap.to(menusRef.current, { scrollLeft: menusRef.current.scrollLeft - (menusRef.current.firstElementChild.offsetWidth + parseInt(getComputedStyle(menusRef.current).gap)) })
  })
  const forward = contextSafe(() => {
    gsap.to(menusRef.current, { scrollLeft: menusRef.current.scrollLeft + (menusRef.current.firstElementChild.offsetWidth + parseInt(getComputedStyle(menusRef.current).gap)) })
  })

  return (
    <div className={`${hidden !== true && 'hidden'}`}>
      <div onClick={() => { back() }} className='absolute z-[1] top-1/2 cursor-pointer left-[-1.25rem] -translate-y-1/2 flex items-center justify-center w-[2.5rem] h-[2.5rem] rounded-[50px] bg-[#cecdda24] dark:hover:bg-[#cfcfcf1a]  hover:bg-[#0000001a] backdrop-blur-[20px]'>
        <svg className='dark:drop-shadow-[0.25rem_0.0625rem_0.0625rem_black] drop-shadow-[0.1875rem_0px_0.0625rem_black] w-[1.375rem] h-[1.375rem]' viewBox="0 0 24 24" color={value === 'dark' ? 'white' : 'black'}><path fill="currentColor" d="M17.51 3.87L15.73 2.1L5.84 12l9.9 9.9l1.77-1.77L9.38 12z" /></svg>
      </div>
      <div onClick={() => { forward() }} className='absolute z-[1] top-1/2 cursor-pointer right-[-1.25rem] -translate-y-1/2 flex items-center justify-center w-[2.5rem] h-[2.5rem] rounded-[50px] bg-[#cecdda24] dark:hover:bg-[#cfcfcf1a] hover:bg-[#0000001a] backdrop-blur-[20px]'>
        <svg className='dark:drop-shadow-[0.25rem_0.0625rem_0.0625rem_black] drop-shadow-[0.1875rem_0px_0.0625rem_black] w-[1.375rem] h-[1.375rem]' viewBox="0 0 24 24" color={value === 'dark' ? 'white' : 'black'}><path fill="currentColor" d="M6.23 20.23L8 22l10-10L8 2L6.23 3.77L14.46 12z" /></svg>
      </div>
    </div>
  )
}

